static void write_file_strings_to_tempfiles(std::string const& temp_filename, std::string const& image_name) {
    std::stringstream ss;
    std::string s0 = get_file_strings(image_name);

    std::ofstream ostr0(temp_filename.c_str());
    if (!ostr0)
        std::cout << "Not Open. Can't write to " << temp_filename << std::endl;
    if (ostr0) {
        ss << s0;
        ostr0 << ss.str();
        std::string::size_type ext = image_name.find(".wrl");
        if (ext != std::string::npos) {
            ss.str(std::string()); // Empty stringstream
            for (size_t i = 1; i < 89; ++i) {
                std::string str_insert = "_" + std::to_string(i);
                std::string temp_image_name = image_name;
                temp_image_name.insert(ext, str_insert);
                s0 = get_file_strings(temp_image_name);
                ss << s0;
                ostr0 << ss.str();
                ss.str(std::string()); // Empty stringstream
            }
        }
        ostr0.close();
        ss.str(std::string()); // Empty stringstream
    }
}

